import React from "react";

const Employee = (props) => {
  return (
    <li>
      <p>
        <label>{props.name}</label>
      </p>
      <p>
        Age
        <label>{props.age}</label>
      </p>
      <p>
        Employee_id
        <label>{props.employ_id}</label>
      </p>
      <p>
        <label>{props.department}</label>
      </p>
    </li>
  );
};
export default Employee;
